    { id: 1, todoname: '운동하기', completed: 0 },
    { id: 2, todoname: 'sns 꾸미기', completed: 0 },
    { id: 3, todoname: '사진정리하기', completed: 0 },
  ];
  return <div></div>;
}

export default App;
